import {Dialogs} from "./Dialogs/Dialogs";
import {Route, Routes} from "react-router-dom";

function App() {
    return (
        <div className="app-wrapper">
            <Header />
            <Navbar />
            <Profile />
        </div>
);
}

export default App;
